import React, { useState } from 'react';
import { Row, Col, Form, Button } from 'react-bootstrap';
import generateProtocolsFunction from './GenerateProtocolFunction';
import styles_base from '../FormsBase.module.css';

const GenerateProtocols = ({ composition_of_sec, groups_for_schedule, requestAndWorkProtection }) => {
    const [selectedGroups, setSelectedGroups] = useState([]);
    const [dateStart, setDateStart] = useState('');
    const [audienceNumber, setAudienceNumber] = useState('');

    const handleGroupSelect = (groupName, isChecked) => {
        setSelectedGroups(prevSelectedGroups => {
            if (isChecked) {
                return [...prevSelectedGroups, groupName];
            } else {
                return prevSelectedGroups.filter(name => name !== groupName);
            }
        });
    };

    const handleSubmit = async (event) => {
        event.preventDefault();
        await generateProtocolsFunction({
            composition_of_sec: composition_of_sec,
            selectedGroups: selectedGroups,
            dateStart: dateStart,
            audienceNumber: audienceNumber,
        });
    };

    const countRequestsPerGroup = () => {
        const groupCounts = {};
        requestAndWorkProtection.forEach(item => {
            const groupName = item.request.student.group.name;
            if (groupCounts[groupName]) {
                groupCounts[groupName]++;
            } else {
                groupCounts[groupName] = 1;
            }
        });
        return groupCounts;
    };

    const groupCounts = countRequestsPerGroup();

    return (
        <Row className="justify-content-center">
            <Col md={7}>
                <h4 className="mb-4 text-center">Генерация протоколов</h4>
                <Form className="px-4 py-2 m-2" onSubmit={handleSubmit}>
                    <Form.Group className="mb-3">
                        <Form.Label>Выберите нужные группы:</Form.Label>
                        <ul>
                            {groups_for_schedule.map(group => (
                                <li key={group.id}>
                                    <Form.Check
                                        type="checkbox"
                                        id={group.id}
                                        label={`${group.name} (${groupCounts[group.name] || 0} запросов)`}
                                        onChange={(e) => handleGroupSelect(group.name, e.target.checked)}
                                    />
                                </li>
                            ))}
                        </ul>
                        <div id="selected-items">
                            Выбранные группы: {selectedGroups.join(', ')}
                        </div>
                    </Form.Group>
                    <Form.Group className="mb-3">
                        <Form.Label>Введите дату начала защиты ВКР:</Form.Label>
                        <Form.Control type="date" value={dateStart} onChange={(e) => setDateStart(e.target.value)} />
                    </Form.Group>
                    <Form.Group className="mb-3">
                        <Form.Label>Введите аудиторию:</Form.Label>
                        <Form.Control type="text" value={audienceNumber} onChange={(e) => setAudienceNumber(e.target.value)} />
                    </Form.Group>
                    <Button type="submit" className={styles_base.button}>
                        Создать протокол
                    </Button>
                </Form>
            </Col>
            <hr className={styles_base.vertical_line}/>
            <Col md={4} className="mt-5">
                <ol>
                    <li>Выберите нужные группы из списка</li>
                    <li>Введите дату начала защиты ВКР</li>
                    <li>Введите аудиторию</li>
                    <li>Нажмите “Создать протокол”</li>
                </ol>
            </Col>
        </Row>
    );
};

export default GenerateProtocols;
